import React from 'react';

import logo from '../../img/logo.jpg';

import './header.styles.scss';

const Header = () => (
    <div className='header'>
        <h1 className='header__logo'>BUTTONED-UP</h1>
        <div className='header__text'>
            <h3 className='header__options'>Women</h3>
            <h3 className='header__options'>Men</h3>
            <h3 className='header__options'>All fashion essentials</h3>
        </div>
        
    </div>
)

export default Header;
